const categorias = [entradas, platos, postres, bebidas, licores];


$(document).ready(function(){

    //Codigo para cambiar de idioma en la pagina
    var check = document.querySelector('.check');
    console.log(check)
    $('.check').on('click',function(e){
        let id = check.checked;

        //Redirecciona a la pagina traducida a ingles
        if(id){
            location.href = "english/index.html";
        } else {
            location.href = "../index.html";
        }
    });


    function mostrarPlatos(categoria) {
        const resultados = $(".resultados");
        resultados.empty();

        let categoriaSeleccionada;

        //Se identifica cual categoria se seleccionó
        if(categoria == "entradas") categoriaSeleccionada = categorias[0];
        if(categoria == "platos")  categoriaSeleccionada = categorias[1];
        if(categoria == "postres") categoriaSeleccionada = categorias[2];
        if(categoria == "bebidas") categoriaSeleccionada = categorias[3];
        if(categoria == "licores") categoriaSeleccionada = categorias[4];

        //Se muestra resultado por resultado
        categoriaSeleccionada.forEach(plato => {
            const card = $("<div class='card'>");
            card.append($("<h4>").text(plato.nombre));
            card.append($("<p>").text(plato.descripcion));
            card.append($("<span>").text(plato.precio));
            card.append($("<img>").attr('src',plato.imagen));
            resultados.append(card);
        });
    }

    // Mostrar las entradas al cargar la página
    mostrarPlatos("entradas");


    //Este evento registra cuando se cambia de categoria para remover los resultados anteriores y listar los nuevos
    $(".categorias .card").click(function (e) {
        e.preventDefault();
        $(".categorias .card").removeClass("seleccionado");
        $(this).addClass("seleccionado");
        const categoria = $(this).data("categoria");

        mostrarPlatos(categoria);
    });
});